import React from "react";
// import Log from "./Log";
import Navigation from "./Navigation";
import Logs from "./Logs";
import "bootstrap/dist/css/bootstrap.css";
import { ToastContainer } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
export default class App extends React.Component {
  constructor() {
    super();
    this.state = {
      continent: "",
      country: "",
      title: "",
      body: "",
    };
  }
  componentDidMount() {}
  render() {
    return (
      <Router>
        <div className="container">
          <Navigation />
          <Switch>
            <Route path="/about">
              <div>About page here...</div>
            </Route>
            <Route path="/contact">
              <div>Contact page with comment here...</div>
            </Route>
            <Route path="/logs/new" component={CreateLogForm} />
            {/* <Route path="/logs/:logId/edit" component={EditLogForm} />
            <Route path="/logs/:logId" component={Log} /> */}
            <Route path="/">
              <Logs />
            </Route>
          </Switch>
        </div>
        <ToastContainer />
      </Router>
    );
  }
}
